import './index.css';

const employee= {
  name: 'Tom',
  location: 'New York',
  bloodGroup: 'B+',
  age: 28,
  profileImg: 'https://www.w3schools.com/howto/img_avatar.png'
       }


function Profile(){
    return(
    <div className="profile">
    <img id="y" src={employee.profileImg} alt='profileImg'/>
    <p className='name'>{employee.name}</p>
    <h4>Location</h4>
    <p>{employee.location}</p>
    <h4>Blood group</h4>
    <p>{employee.bloodGroup}</p>
    <h4>Age</h4>
    <p>{employee.age}</p>
    </div>
    );
  }
let App=()=>Profile(employee)
export default Profile;
